set feedback off verify off echo off termout off newpage 0
drop table Supplier cascade constraints;
drop table PurchaseOrder cascade constraints;
drop table SuppliedPart cascade constraints;
drop table PurchOrderLine cascade constraints;
drop table Employee cascade constraints;
drop table InventoryPart cascade constraints;
drop table BillOfMaterials cascade constraints;
drop table Operation cascade constraints;
drop table TimeCardLine cascade constraints;
drop table Category cascade constraints;
drop table ProcessRouting cascade constraints;
