create table Supplier(
	SupplierID		varchar2(10) 	,	
	CompanyName		varchar2(30)	,
	ContactName		varchar2(20)	,
	ContactTitle		varchar2(5)	,
	Address			varchar2(40)	,
	City			varchar2(20)	,
	State			varchar2(2)	,
	PostalCode		varchar2(10)	,	
	Phone			varchar2(12)	,
	Fax			varchar2(12)	,
	EmailAddr		varchar2(50)	
);
create table PurchaseOrder(
	PurchOrderID		varchar2(10)	,
	SupplierID		varchar2(10)	,
	EmployeeID		varchar2(10)	,
	DateOrdered		date		,
	DateDelivered		date		,
	PaidInFull		varchar(1)	
);
create table SuppliedPart(
	SupplierID		varchar2(10)	,
	CatalogNumber		varchar2(10)	,
	PartNumber		varchar2(10)	,
	UnitCost		number(9,2)	,		
	UnitOfMeasure		number(5)	,
	ShippingLag		number(3)	
);
create table PurchOrderLine(
	PurchOrderID		varchar2(10)	,
	SupplierID		varchar2(10)	,
	CatalogNumber		varchar2(10)	,
	UnitQuantity		number(9)	,		
	OrderedUnitCost		number(9,2)	
);
create table Employee(
	EmployeeID		varchar2(10)	,
	LastName		varchar2(20)	,
	FirstName		varchar2(15)	,
	JobTitle		varchar2(35)	,
	StreetAddress		varchar2(40)	,
	City			varchar2(20)	,
	State			varchar2(2)	,	
	PostalCode		varchar2(10)	,	
	HomePhone		varchar(12)	,
	SetupAllowed		varchar2(1)	,	
	HireDate		date		,
	ReleaseDate		date		,
	Type			varchar2(10)	,	
	TempService		varchar2(10)	,
	LockerNumber		varchar2(6)	,	 
	Birthdate		date		,
	StampNumber		varchar2(6)	,	
	Supervisor		varchar2(10)	,
	EmailAddr		varchar2(50)	,
	SalaryWage		number(9,2)	
);
create table InventoryPart(
	PartNumber		varchar2(10)	,
	PartDescription		varchar2(50)	,
	CategoryID		varchar2(10)	,
	EOQ			number(4)	,	
	StockPrice		number(9,2)	,	
	ReorderLevel		number(5)	,		
	StockLevel		number(5)	,		
	StockOnOrder		number(5)	,		
	Weight			number(9,3)	
);
create table BillOfMaterials(
	PartNumber		varchar2(10)	,
	SubPartNumber		varchar2(10)	,
	PieceQuantity		number(9)	
);
create table Operation(
	ECNumber		varchar2(10)	,
	ProcessID		varchar2(10)	,
	PartNumber		varchar2(10)	,
	OperationStep		varchar2(10)	,
	Instruction		varchar2(45)	
);
create table TimeCardLine(
	EmployeeID		varchar2(10)	,
	DateTimeStart		date		,		
	ECNumber		varchar2(10)	,
	MachineID		varchar2(10)	,
	ProcessID		varchar2(10)	,
	PartNumber		varchar2(10)	,
	DateTimeStop		date		,		
	GoodParts		number(9)	,		
	ReworkParts		number(9)	,		
	ScrapParts		number(9)	,		
	MachineRunTime		number(9)	,	
	SetupTime		number(9)	,	
	MaintenanceTime		number(9)	,
	TrainingTime		number(9)	,	
	Cleanuptime		number(9)	,	
	ReworkTime		number(9)	,	
	ToolingTime		number(9)	,	
	OtherTime		number(9)	
);
create table Category(
	categoryID		varchar2(10)	,
	CategoryName		varchar2(30)	,
	Description		varchar2(100)	
);
create table ProcessRouting(
	ECNumber		varchar2(10)	,
	PartNumber		varchar2(10)	,
	RoutingTime		varchar2(5)	,
	EffectiveDate		date		,
	RevisionLevel		varchar2(10)	,	
	Comments		varchar2(50)	
);
create table Process(
	ECNumber		varchar2(10)	,
	ProcessID		varchar2(10)	,
	PartNumber		varchar2(10)	,
	Purpose			varchar2(30)	
);
create table MachineProcess(
	ECNumber		varchar2(10)	,
	MachineID		varchar2(10)	,
	ProcessID		varchar2(10)	,
	PartNumber		varchar2(10)	,
	TimeStandard		number		
);
create table Machine(
	MachineID		varchar2(10)	,
	CellAreaID		varchar2(10)	,
	SerialNumber		varchar2(10)	,
	InServiceDate		date		,	
	ManufacturerName	varchar2(25)	,
	Make			varchar2(25)	,
	Model			varchar2(25)	
);
create table CustOrderLine(
	OrderID			varchar2(10)	,
	PartNumber		varchar2(10)	,
	UnitPrice		number(9,2)	,	
	OrderQuantity		number(9)	,	
	Discount		number(6,2)	,	
	Status			varchar2(15)	
);
create table ShippedItem(
	OrderID			varchar2(10)	,
	PartNumber		varchar2(10)	,
	ShipmentID		varchar2(10)	,
	PackageNumber		number(10)	,	
	QuantityShipped		number(9)	
);
create table CustOrder(
	OrderID			varchar2(10)	,
	CustomerID		varchar2(10)	,
	OrderDate		date		,
	RequiredDate		date		
);
create table Shipment(
	ShipmentID		varchar2(10)	,
	OrderID			varchar2(10)	,
	ShipperID		number(4)	,
	ShipName		varchar2(20)	,
	ShipAddress		varchar2(40)	,
	ShipCity		varchar2(20)	,
	ShipState		varchar2(2)	,
	ShipPostalCode		varchar2(10)	
);
create table PackingSlip(
	ShipmentID		varchar2(10)	,
	PackageNumber		number(10)	,	
	EmployeeID		varchar2(10)	,
	ShippedDate		date		
);
create table Customer(
	CustomerID		varchar2(10)	,
	CompanyName		varchar2(40)	,	
	CustFirstName		varchar2(15)	,
	CustLastName		varchar2(20)	,	
	CustTitle		varchar2(5)	,	
	Address			varchar2(40)	,
	City			varchar2(20)	,
	State			varchar2(2)	,
	PostalCode		varchar2(10)	,
	Phone			varchar2(12)	,
	Fax			varchar2(12)	,
	EmailAddr		varchar2(50)	
);
create table Shipper(
	ShipperID		number(4)	,
	ShipperName		varchar2(25)	,
	ContactName		varchar2(20)	,
	Phone			varchar2(12)	,
	EmailAddr		varchar2(50)	,
	Fax			varchar2(12)	,
	MaxPackageWeight	number(9,2)	,	
	FreightPerLb		number(9,2)	
);
alter table Supplier add constraint Supplier_pk 
	primary key (SupplierID);
alter table PurchaseOrder add constraint Purchase_Order_PK
	primary key (PurchOrderID);
