	primary key (ECNumber,PartNumber);
alter table Process add constraint Processing_PK 
	primary key (ECNumber,ProcessID,PartNumber);
alter table MachineProcess add constraint MachineProcess_PK 
	primary key (ECNumber,MachineID,ProcessID,PartNumber);
alter table Machine add constraint Machine_PK 
	primary key (MachineID);
alter table CustOrderLine add constraint CustOrderLine_PK 
	primary key (OrderID,PartNumber);
alter table ShippedItem add constraint ShippedItem_PK 
	primary key (OrderID,PartNumber,ShipmentID,PackageNumber);
alter table CustOrder add constraint CustOrder_PK 
	primary key (OrderID);
alter table Shipment add constraint Shipment_PK 
	primary key (ShipmentID);
alter table PackingSlip add constraint PackingSlip_PK 
	primary key (ShipmentID,PackageNumber);
alter table Customer add constraint Customer_PK 
	primary key (CustomerID);
alter table Shipper add constraint Shipper_PK 
	primary key (ShipperID);

